(3,	'',	'faq',	'<section class=\"faq p-10\">\r\n<div class=\"container\">\r\n<h2 class=\"title\">&nbsp;</h2>\r\n<h3>Searching for Watches on WATCHMYBID</h3>\r\n<div class=\"faq__group\">\r\n<div class=\"faq__start\">Q</div>\r\n<div class=\"faq__end\">How do I search for a watch on WMB?</div>\r\n</div>\r\n<div class=\"faq__group faq__group--answer\">\r\n<div class=\"faq__start\">A</div>\r\n<div class=\"faq__end faq__end--answer\">You can view the app via the tabs at the top.</div>\r\n</div>\r\n<div class=\"faq__group\">\r\n<div class=\"faq__start\">Q</div>\r\n<div class=\"faq__end\">How do I filter search results for specific listings?</div>\r\n</div>\r\n<div class=\"faq__group faq__group--answer\">\r\n<div class=\"faq__start\">A</div>\r\n<div class=\"faq__end faq__end--answer\">You can set this on your profile setting.</div>\r\n</div>\r\n<div class=\"faq__group\">\r\n<div class=\"faq__start\">Q</div>\r\n<div class=\"faq__end\">Why do luxury watches have reference numbers?</div>\r\n</div>\r\n<div class=\"faq__group faq__group--answer\">\r\n<div class=\"faq__start\">A</div>\r\n<div class=\"faq__end faq__end--answer\">So the traders are linked with a ref no so we can track the item.</div>\r\n</div>\r\n<h3>Buying Watches</h3>\r\n<h4>General</h4>\r\n<div class=\"faq__group\">\r\n<div class=\"faq__start\">Q</div>\r\n<div class=\"faq__end\">How can I buy a watch?</div>\r\n</div>\r\n<div class=\"faq__group faq__group--answer\">\r\n<div class=\"faq__start\">A</div>\r\n<div class=\"faq__end faq__end--answer\">Bid on the app and if you win and seller agrees you buy the watch</div>\r\n</div>\r\n<div class=\"faq__group\">\r\n<div class=\"faq__start\">Q</div>\r\n<div class=\"faq__end\">What determines the total price of a watch?</div>\r\n</div>\r\n<div class=\"faq__group faq__group--answer\">\r\n<div class=\"faq__start\">A</div>\r\n<div class=\"faq__end faq__end--answer\">Sellers ask vs buyers bid</div>\r\n</div>\r\n<div class=\"faq__group\">\r\n<div class=\"faq__start\">Q</div>\