\"faq__end faq__end--answer\">To be verified with dealer</div>\r\n</div>\r\n<h3>Buyer Protection</h3>\r\n<div class=\"faq__group\">\r\n<div class=\"faq__start\">Q</div>\r\n<div class=\"faq__end\">What is your Buyers Protection?</div>\r\n</div>\r\n<div class=\"faq__group faq__group--answer\">\r\n<div class=\"faq__start\">A</div>\r\n<div class=\"faq__end faq__end--answer\">If a wmb dealer has not met his T&amp;Cs we will hold them liable and support the buyer</div>\r\n</div>\r\n<h4>General</h4>\r\n<div class=\"faq__group\">\r\n<div class=\"faq__start\">Q</div>\r\n<div class=\"faq__end\">Why should I create an account?</div>\r\n</div>\r\n<div class=\"faq__group faq__group--answer\">\r\n<div class=\"faq__start\">A</div>\r\n<div class=\"faq__end faq__end--answer\">To be able to access all watches from UAE.</div>\r\n</div>\r\n<div class=\"faq__group\">\r\n<div class=\"faq__start\">Q</div>\r\n<div class=\"faq__end\">How do I edit my personal information?</div>\r\n</div>\r\n<div class=\"faq__group faq__group--answer\">\r\n<div class=\"faq__start\">A</div>\r\n<div class=\"faq__end faq__end--answer\">On profile page.</div>\r\n</div>\r\n<div class=\"faq__group\">\r\n<div class=\"faq__start\">Q</div>\r\n<div class=\"faq__end\">How can I change my password?</div>\r\n</div>\r\n<div class=\"faq__group faq__group--answer\">\r\n<div class=\"faq__start\">A</div>\r\n<div class=\"faq__end faq__end--answer\">On Settings.</div>\r\n</div>\r\n<div class=\"faq__group\">\r\n<div class=\"faq__start\">Q</div>\r\n<div class=\"faq__end\">How can I delete my account?</div>\r\n</div>\r\n<div class=\"faq__group faq__group--answer\">\r\n<div class=\"faq__start\">A</div>\r\n<div class=\"faq__end faq__end--answer\">Please email the team.</div>\r\n</div>\r\n<div class=\"faq__group\">\r\n<div class=\"faq__start\">Q</div>\r\n<div class=\"faq__end\">Can I send messages to your team?</div>\r\n</div>\r\n<div class=\"faq__group faq__group--answer\">\r\n<div class=\"faq__start\">A</div>\r\n<div class=\"faq__e