(5,	'About Us',	'about',	'<p>WatchMyBid is the first platform of its kind in the middle east offering buyers and sellers of watches a platform to list the watches they have and get an instant cash offer. Only verified traders are registered so you know the bid is secure.</p>\r\n<p>Founded by Faiyaz Chand having exited as part of the middle east first unicorn as part of the 1 billion valuation merger. Faiyaz has now set out to create the most customer centric tech platform across the world of watches.</p>',	'en',	'2018-08-30 07:05:42',	'2021-06-18 13:07:51'),
